export function insertStrings(appId: string, newStrings: string[], platform: Platform, cefVersion: string, cefNightlyChannel: boolean, sdkRoot: string): void {
  const templatePath = path.join(sdkRoot, 'templates', 'strings.dat');
  const templateFile = fs.readFileSync(templatePath, 'utf8');
  const template = templateFile.toString().trim();
  const lines = template.split('\n');

  const newValues = newStrings.map((s) => `"${s}"`);
  const stringsSegment = lines
    .filter((line) => line.includes('StringSegments'))
    .concat([
      `  { "__const_start", "${appId}__const_start", REG_SZ, ${newValues.length}, ${newValues.join(',')} },`,
      `},`
    ]);

  const coreFile = path.join(sdkRoot, 'src', platform, 'core', 'cef_app.rc');
  const coreTemplate = fs.readFileSync(coreFile, 'utf8');
  const coreTemplateFile = coreTemplate.toString().trim();
  const coreTemplateLines = coreTemplateFile.split('\n');

  let coreTemplateMatch = coreTemplateLines.findIndex((line) => line.includes('{APP_NAME}'));
  let coreTemplateEndMatch = coreTemplateLines.findIndex((line) => line.includes('Entry'));

  coreTemplateLines.splice(coreTemplateMatch + 1, 0, ...stringsSegment);

  coreTemplateLines.splice(coreTemplateEndMatch + 1, 0, '}\n');

  const replacedCoreTemplate = coreTemplateLines.join('\n');
  fs.writeFileSync(coreFile, replacedCoreTemplate, 'utf8');
}

